-- ----------------------------
-- Procedure structure for get_order_by_user
-- ----------------------------
DROP PROCEDURE IF EXISTS `get_order_by_user`;
delimiter ;;
CREATE PROCEDURE `get_order_by_user`(in user_id int)
BEGIN
#buy
SELECT `order`.*, user.USERNAME FROM `order` INNER JOIN user on order.OWNERID = user.USERID WHERE BUYERID = user_id;
#sell
SELECT `order`.*, user.USERNAME FROM `order` INNER JOIN user on order.BUYERID = user.USERID WHERE OWNERID = user_id;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for order_create
-- ----------------------------
DROP PROCEDURE IF EXISTS `order_create`;
delimiter ;;
CREATE PROCEDURE `order_create`(in product_id int, in owner_id int, in buyer_id int)
BEGIN

SELECT PRODUCTNAME INTO @product_name FROM product WHERE PRODUCTID = product_id;
INSERT INTO `order` (PRODUCTID, PRODUCTNAME, OWNERID, BUYERID) VALUES (product_id, @product_name, owner_id, buyer_id);
UPDATE product SET `STATUS` = '交易中' WHERE PRODUCTID = product_id;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for order_detail
-- ----------------------------
DROP PROCEDURE IF EXISTS `order_detail`;
delimiter ;;
CREATE PROCEDURE `order_detail`(in order_id int)
BEGIN

SELECT BUYERID, OWNERID, PRODUCTID INTO
@buyer_id, @owner_id, @product_id
FROM `order` WHERE ORDERID = order_id;

select * FROM `order` where ORDERID = order_id;
SELECT * FROM user WHERE USERID = @buyer_id;
SELECT * FROM user WHERE USERID = @owner_id;
SELECT * FROM product WHERE PRODUCTID = @product_id;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for order_drop
-- ----------------------------
DROP PROCEDURE IF EXISTS `order_drop`;
delimiter ;;
CREATE PROCEDURE `order_drop`(in order_id int)
BEGIN
UPDATE product SET `STATUS` = '已发布' WHERE PRODUCTID = (SELECT PRODUCTID FROM `order` WHERE ORDERID = order_id);
DELETE FROM `order` WHERE ORDERID = order_id;

END
;;
delimiter ;

